import React from "react";
import emojipedia from "../emojipedia";
import Ret from "./Emoji";

function emojiRender(emojipedia) {
  return <Ret emoji={emojipedia.emoji} title={emojipedia.name} body={emojipedia.meaning} />
}

function App() {
  return <div>
    <h1>
      <span>emojipedia</span>
    </h1>
    {emojipedia.map(emojiRender)}
  </div>
}

export default App;
